import React, { useState } from "react";
import { FaCamera } from "react-icons/fa";

type Setting = {
    name: string;
    value: string;
};

type SettingProps = {
    settings: Setting[];
    onSave: (settings: Setting[]) => void;
};

const SettingPage: React.FC = ({ }) => {
    //   const [updatedSettings, setUpdatedSettings] = useState(settings);
    const [updatedSettings, setUpdatedSettings] = useState(false);
    const [avatar_image, setAvatar_image] = useState("");
    const [nickname, setNickname] = useState("John Doe");
    const [username, setusername] = useState("");

    const handleSave = () => {
        // onSave(updatedSettings);
    };

    const handleSettingChange = (index: number, event: React.ChangeEvent<HTMLInputElement>) => {
        // const newSettings = [...updatedSettings];
        // newSettings[index].value = event.target.value;
        // setUpdatedSettings(newSettings);
        setUpdatedSettings(true);
    };

    const handleProfileImageChange = (event: React.ChangeEvent<HTMLInputElement>) => {
        // const file = event.target.files?.[0];
        // if (file) {
        //     const reader = new FileReader();
        //     reader.onloadend = () => {
        //         setProfileImage(reader.result as string);
        //     };
        //     reader.readAsDataURL(file);
        // }
    };


    return (
        <div
            style={{
                // backgroundColor: "rgba(132, 0, 0, 0.9)",
                // height: "100vh",
                backgroundSize: "cover",
                backgroundRepeat: "no-repeat",
                backgroundPosition: "center",
                display: 'flex',
                padding: '0 20px',
                flexDirection: 'column',
                justifyContent: 'space-between',
                boxSizing: "border-box",

                position: "relative",
                // width: "100vh",
                height: "896px",

                background: "#B12D2D",
                border: "1px solid #661212",
                borderRadius: "12px",
            }}>
            <div
                style={{
                    display: "flex",
                    alignItems: "center"
                }}>
                {avatar_image ? (
                    <img src={avatar_image} alt="Profile" style={{ width: "150px", height: "150px", borderRadius: "50%" }} />
                ) : (
                    <div>
                        <label htmlFor="profile-image-input">
                            <div
                                style={{
                                    width: "200px",
                                    height: "200px",
                                    // left: "150px",
                                    // top: "62px",
                                    borderRadius: "50%",
                                    backgroundColor: "#ccc",
                                    display: "flex",
                                    justifyContent: "center",
                                    alignItems: "center",
                                    cursor: "pointer",
                                    textAlign: "center",
                                    transform: 'translate(20%, 30%)',
                                }}
                            >
                                <FaCamera size={60} color="#fff" />
                            </div>
                            <div style={{
                                cursor: "pointer",
                                transform: 'translate(10%, 700%)',
                                textAlign: "justify",
                                position: "absolute",
                                width: "336px",
                                height: "32px",
                                left: "26px",
                                top: "48.37px",
                                fontFamily: 'Figma Hand',
                                fontStyle: "normal",
                                fontWeight: 400,
                                fontSize: "21px",
                                lineHeight: "150%",
                                color: "#E6E6E6",
                            }} >
                                Change profile image
                            </div>
                        </label>
                        <input
                            type="file"
                            accept="image/*"
                            id="profile-image-input"
                            onChange={handleProfileImageChange}
                            style={{ display: "none" }}
                        />
                    </div>
                )
                }
                <div
                    style={{
                        position: "absolute",
                        width: "600px",
                        height: "36px",
                        left: "300px",
                        top: "120px",
                        fontFamily: 'Figma Hand',
                        fontStyle: "normal",
                        fontWeight: 80,
                        fontSize: "24px",
                        lineHeight: "150%",
                        color: "#ccc",
                        // transform: 'translate(-50%, 120%)',
                    }}
                >
                    <label htmlFor="nickname">Nick Name: </label>
                    <input

                        style={{
                            fontSize: "16px",
                            backgroundColor: "#ccc",
                        }}
                        type="text"
                        id="nickname"
                        value={nickname}
                        onChange={(e) => setNickname(e.target.value)}
                    />
                </div>
                <div
                    style={{
                        // fontSize: "20px",
                        // transform: 'translate(-80%, 270%)',
                        position: "absolute",
                        width: "600px",
                        height: "36px",
                        left: "300px",
                        top: "160px",
                        fontFamily: 'Figma Hand',
                        fontStyle: "normal",
                        fontWeight: 80,
                        fontSize: "24px",
                        lineHeight: "150%",
                        color: "#ccc",

                    }}>
                    <label htmlFor="username">User Name: </label>
                    <input
                        style={{
                            fontSize: "16px",
                            backgroundColor: "#ccc",
                        }}
                        type="text"
                        id="username"
                        value={username}
                        onChange={(e) => setusername(e.target.value)}
                    />
                </div>
            </div >

            <h1 style={{
                display: 'flex',
                left: "80px",
                top: "80.73px",
                position: "relative",
                fontFamily: "Times New Roman",
                color: "#ccc",
                fontSize: 20,
                zIndex: 66,
            }}>Achievements</h1>
            <div
                style={{
                    backgroundColor: "#ccc",
                    position: "relative",
                    width: "250px",
                    height: "400px",
                    left: "20px",
                    top: "45.73px",
                    display: "flex",
                    flexDirection: "column",
                    // justifyContent: "center", 
                    alignItems: "center"
                }}

            >
                <div style={{
                    width: "247px",
                    height: "150px",
                    borderRadius: "40%/50%",
                    border: "1.5px dashed red",
                    color: "#B12D2D",
                    marginBottom: "10px",
                    // backgroundImage: "radial-gradient(circle at center, , #ff00f0)",
                    // position: "absolute",
                    // width: "252px",
                    // height: "73px",
                    // left: "32px",
                    // top: "40.55px",

                    fontFamily: 'Inter',
                    fontStyle: "normal",
                    fontWeight: 700,
                    fontSize: "24px",
                    lineHeight: "150%",
                    /* or 36px */
                    // letterSpacing: "-0.019em",

                    // color: "rgba(0, 0, 0, 0.8)",


                }}>

                </div>
                <div style={{
                    width: "247px",
                    height: "150px",
                    borderRadius: "40%/50%",
                    border: "1.5px dashed red",
                    color: "#B12D2D",
                    left: "72px",
                    top: "800px",
                    // backgroundImage: "radial-gradient(circle at center, , #ff00f0)",
                }}>

                </div>
                <h1></h1>show more
            </div>
            {/* {updatedSettings.map((setting, index) => (
                <div key={setting.name}>
                    <label 
                    htmlFor={setting.name}>{setting.name}:</label>
                    <input
                        type="text"
                        id={setting.name}
                        value={setting.value}
                        onChange={(e) => handleSettingChange(index, e)}
                    />
                </div>
            ))} */}
            {/* {updatedSettings.map((setting, index) => (
                <div key={index}> */}
            <label>
                {/* {setting.name}
                        <input type="text" ></input>
                        value={setting.value} onChange={(event) => handleSettingChange(index, event)} /> */}
            </label>
            {/* </div>))} */}
            <button
                style={{ fontSize: "30px" }}
                onClick={handleSave}>
                Save
            </button>
        </div >
    );
};

export default SettingPage;
